import React from "react";
import ApolloClient from "apollo-boost";
import { ApolloProvider } from "react-apollo";

import "./App.css";
import Navbar from "./components/Navbar/Navbar";

/*import { Navbar, Characters } from "./comms";*/
import Home from "./pages/home/Home";
import Landing from "./pages/Landing/Landing";
/*import Details from "./pages/Details/Details";*/
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useParams,
} from "react-router-dom";
import CharacterDetails from "./components/Characters/Character/CharacterDetails/CharacterDetails";
import Characters from "./components/Characters/Characters";

const client = new ApolloClient({
  uri: "http://localhost:5000/graphql",
});
const App = () => {
  return (
    <ApolloProvider client={client}>
      <Router>
        <Navbar />

        <Switch>
          <Route exact path="/">
            <Landing />
          </Route>

          <Route path="/home" component={Characters}></Route>

          <Route exact path="/details/:id" component={CharacterDetails}>
            <CharacterDetails />
          </Route>
        </Switch>
      </Router>
    </ApolloProvider>
  );
};

export default App;
